import React from 'react';
import styled from 'styled-components';
import bgImg from '../assets/bg.png';

const App = () => {
  return (
    <Container>
      <h1>test</h1>
    </Container>
  )
}

const Container = styled.div`
  background: #FFFFFF; 
`;

const Wrapper = styled.div`
  background-image: url(${bgImg}$);
`;

export default App;
